void WBSlave::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"reset\" :  \"" << reset.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"adr_i\" :  \"" << adr_i.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"dat_i\" :  \"" << dat_i.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"we_i\" :  \"" << we_i.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"stb_i\" :  \"" << stb_i.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"cyc_i\" :  \"" << cyc_i.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"sel_i\" :  \"" << sel_i.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"dat_o\" :  \"" << dat_o.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ack_o\" :  \"" << ack_o.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"int_o\" :  \"" << int_o.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

